export default class Product extends Component{
  constructor(props){
    super(props)
  }
  render(){
  return (
    <div>
      {console.log(props.data)}
      {props.data.forEach(item =>console.log(item))}
      {props.data.map((p) => (
        <div
          style={{ height: 150, margin: 10, padding: 10, backgroundColor: "red" }}
        >
          {p.name}
        </div>
        
      ))}
      
      </div>
    
  );
      }
}
